Oh My Pyo Ji is a 2014 romantic comedy Punjabi film directed and produced by Niharika Sahni. The film stars Binnu Dhillon, Babbal Rai, Jaswinder Bhalla, Bhanu Sri Mehra, Nirmal Rishi and debutante Dakshita Kumaria

Cast
Binnu Dhillon as Binnu
Jaswinder Bhalla as Mama
Sardar Sohi as Khunkhar Singh
Babbal Rai as J.J. a.k.a Jabarjung
Nirmal Rishi as Parminder
Bhanu Sri Mehra as Surveen
Dakshita Kumaria Bilal Ashraf

